import React from "react";
import {Clipboard, Image, Text, TouchableOpacity, View} from "react-native";
import {styles} from "../../styles";
import {ImageResources} from "../../common/ImageRecources.g";
import {NavigationBar} from "../../common/NavigationBar";
import {f} from "../../common/t";
import {stores} from "../../core/stores/Stores";
import {Toaster} from "../../common/Toaster";
import {Loading} from "../../common/Loading";
import {PersonHuman} from "../../core/src/core/item/persons/PersonHuman";
import * as _ from "lodash";
import {BackHandled} from "../../common/BackHandled";

export class Identification extends BackHandled<IIdentificationProps, IIdentificationState> {
    //noinspection JSUnusedGlobalSymbols
    static navigationOptions: INavigatorScreenOptions = {
        header: false
    };
    private onAdd = async () => {
        this.setState({loading: true});
        try {
            stores.identificationStore.person = await PersonHuman.parse(this.state.rowData);

            _.delay(async () => {
                this.setState({loading: false});
                stores.navigationStore.navigate("IdentificationPreview");
            }, 100);
        } catch (e) {
            Toaster.error(f`error_9`);
            this.setState({loading: false});
        }
    };
    private pasteFromClipboard = async () => {
        const content = await Clipboard.getString();
        this.setState({rowData: content});
    };
    private menu = () => {
        stores.navigationStore.drawerOpen();
    };

    componentWillMount(): void {
        this.setState({
            rowData: __DEV__ ? "" : f`press icon right`,
            loading: false
        });
    }

    render(): JSX.Element {
        return (
            <View style={styles.userPlus.container}>
                <Loading state={this.state.loading}/>
                <Image source={ImageResources.background} style={styles.shared.topBackgroundImage}/>
                <NavigationBar
                    title={f`Register Person`}
                    leftButton={ImageResources.icon_menu}
                    onLeftButtonPress={this.menu}
                />
                <View style={styles.userPlus.subContainer}>
                    <View style={{...styles.infoItem.container, ...{height: 50, marginBottom: 8}}}>
                        <Text style={styles.infoItem.title}>{f`Insert form buffer`}</Text>
                    </View>
                    <View>
                        <Text
                            style={styles.userPlus.textInput}>{this.state.rowData}</Text>
                        <TouchableOpacity activeOpacity={0.9} onPress={this.pasteFromClipboard}
                                          style={styles.userPlus.button}>
                            <Image style={styles.userPlus.image} source={ImageResources.icon_insert}/>
                        </TouchableOpacity>
                    </View>
                </View>
                <View style={styles.myWallet.bottomContainer}>
                    <TouchableOpacity onPress={this.onAdd} style={styles.myWallet.buttonLeft} activeOpacity={0.9}>
                        <Text style={styles.myWallet.buttonText}>{f`Add`}</Text>
                    </TouchableOpacity>
                </View>
            </View>
        );
    }
}

interface IIdentificationProps extends INavigationProps {
}

interface IIdentificationState {
    rowData: string;
    loading: boolean;
}
